    false,nt"url": null,nt"notes": "The goals of this field trial cruise are
    to test use of EX mapping sensors to characterize complex geological areas (i.e.
    volcanic field) and develop protocols to handle discoveries in terms of communication
    links, public information releases, websites etc. Also during EX0904 CIMS (Cruise
    Information Management System) was brought online, and integration of this system
    with mapping system will be tested during this cruise. Like other field trials,
    this cruise has primary and secondary goals and objectives. Completion of primary
    goals and objectives will make the cruise a success. The primary goal and objectives
    will be achieved in the context of mapping in the vicinity of Mendocino ridge.",nt"license_title":
